class Portfolio_model {
  Portfolio_model({
    int? status,
    dynamic error,
    Messages? messages,
    List<Purchased_item_list>? purchaseditemlist,
  }) {
    _status = status;
    _error = error;
    _messages = messages;
    _purchaseditemlist = purchaseditemlist;
  }

  Portfolio_model.fromJson(dynamic json) {
    _status = json['status'];
    _error = json['error'];
    _messages =
        json['messages'] != null ? Messages.fromJson(json['messages']) : null;
    if (json['Purchased item list'] != null) {
      _purchaseditemlist = [];
      json['Purchased item list'].forEach((v) {
        _purchaseditemlist?.add(Purchased_item_list.fromJson(v));
      });
    }
  }
  int? _status;
  dynamic _error;
  Messages? _messages;
  List<Purchased_item_list>? _purchaseditemlist;

  int? get status => _status;
  dynamic get error => _error;
  Messages? get messages => _messages;
  List<Purchased_item_list>? get purchaseditemlist => _purchaseditemlist;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['error'] = _error;
    if (_messages != null) {
      map['messages'] = _messages?.toJson();
    }
    if (_purchaseditemlist != null) {
      map['Purchased item list'] =
          _purchaseditemlist?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

